token.reduce:
function (keys, values, rereduce) {
  if (rereduce) {
    var result = {
      count: values[0].count,
      vic: values[0].vic,
      nsw: values[0].nsw,
      qs: values[0].qs,
      wa: values[0].wa,
      sa: values[0].sa,
      tas: values[0].tas,
      nt: values[0].nt

    };
    for (var i = 1; i < values.length; i++) {
      result.count = result.count + values[i].count;
      result.vic = result.vic + values[i].vic;
      result.nsw = result.nsw + values[i].nsw;
      result.qs = result.qs + values[i].qs;
      result.sa = result.sa + values[i].sa;
      result.tas = result.tas + values[i].tas;
      result.wa = result.wa + values[i].wa;
      result.nt = result.nt + values[i].nt;
    }
    return result
  }
  // Non-rereduce case
  var result = {
    count: 0,
    vic: 0,
    nsw: 0,
    qs: 0,
    sa: 0,
    tas: 0,
    wa: 0,
    nt: 0

  }

  // add list...
  for (var i = 0; i < keys.length; i++) {

    // if ...
    if (values[i].z.indexOf('Victoria') != -1) {
      result.vic = result.vic + 1
    }
    else if (values[i].z.indexOf('New South Wales') != -1) {
      result.nsw = result.nsw + 1
    }
    else if (values[i].z.indexOf('Queensland') != -1) {
      result.qs = result.qs + 1
    }
    else if (values[i].z.indexOf('South Australia') != -1) {
      result.sa = result.sa + 1
    }
    else if (values[i].z.indexOf('Tasmania') != -1) {
      result.tas = result.tas + 1
    }
    else if (values[i].z.indexOf('Western Australia') != -1) {
      result.wa = result.wa + 1
    }
    else if (values[i].z.indexOf('Northern Territory') != -1) {
      result.nt = result.nt + 1
    }
    result.count = result.count + 1
  }
  return result
}

token.map:
function (doc) {
    z = doc.place.full_name;

    var emojis = ['🍔', '🍟', '🍕', '🌭', '🍰', '🍫', '🍦', '🍨', '🍩', '🍺', '🍻', '😋', '🤤', '🎂', '🍷', '🍬', '🍪', '🍗', '🍜']
    var token_list = ['Burger', 'Fast food', 'Fish and chips', 'Ice cream', 'Junk food', 'Beer', 'Soft drink', 'KFC', 'Alcohol', 'McDonald', 'Hungry Jack', 'Chocolate', 'Cake', 'Doughnut', 'Cheess', 'Fried chicken', 'dominos', 'dessert', 'Candy', 'Bubble Tea','Foodie','Hungry','Full','Eat','Drunk']
    for (var i = 0; i < token_list.length; i++) {
        token_list[i] = token_list[i].toLowerCase()
    }
    var all = token_list.concat(emojis)
    for (var i = 0; i < all.length; i++) {
        if (doc.text.toLowerCase().indexOf(all[i]) != -1) {
            emit(doc.text, { z: z });
            break;
        }
    }
}

